// Access the input content from the first item
let input = $('Discord Trigger').first().json.content;

// Remove protocol (http, https)
let noProtocol = input.replace(/^https?:\/\//, '');

// Remove trailing slashes
noProtocol = noProtocol.replace(/\/+$/, '');

// Extract just the domain (e.g., ups.com)
let domain = noProtocol.split('/')[0];

// Convert to a sanitized version for folder names
let sanitized = domain.replace(/\./g, '_').replace(/[^a-zA-Z0-9_-]/g, '_');

// Return both domain and sanitized name
return [
  {
    json: {
      domain,
      sanitized,
    }
  }
];

// Access the input string from the first item
const input = $('Execute a command6').first().json.stdout;

// Convert escaped \n into actual newlines and split
const lines = input.replace(/\\n/g, '\n').split('\n');

// Create an item for each filename with pairedItem
return lines.map((line, index) => ({
  json: {
    filename: line.trim(),
  },
  pairedItem: {
    item: 0, // All new items are linked to the first input item
  }
}));

const input = $input.first().json.stdout;

// Count real newlines (actual line breaks)
const newlineCount = (input.match(/\n/g) || []).length;

return [
  {
    json: {
      newlineCount
    }
  }
];

